import React from 'react';
import '../styles/content.css'

export default function Content(probs) {

    return (
            <div className="content">
                <div className="contentWrap">
                <div className="textWrap">
                <h1>{probs.überschrift}</h1>
                    <p className="contentText">{probs.text}</p>
                </div>
                <div className="textNumber">
                    <p className="number">25%</p>
                    <p className="numberText">At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, 
                    no sea takimata sanctus est Lorem ipsum dolor sit amet. </p>
                </div>
                </div>
        </div>
    );
}
